const primary_color = '#563D7C';

const MyStyle = {
    col_primary: {
        primary_color,
    },
    col_background: {
        background: primary_color,
        color: "white",
    },
    col_text: {
        color: primary_color
    },
    col_border: {
        // border: `5px solid ${primary_color}`,
        border: '1px solid white',
        background: `${primary_color}`,
        // borderRadius: '20%',
        color: 'white',
    },
    border_right: {
        borderRight: `5px solid ${primary_color}`,
        paddingRight: '2px',
    },
    search_box: {
        width: '80%',
        borderBottom: `2px solid ${primary_color}`,
        margin: '0px 2.5px 0px 2px',
    }

}

export default MyStyle;
